        private static List<string> Blink(List<string> stones)
        {
            var retVal = new List<string>();
            foreach (var stone in stones)
            {
                if (Double.Parse(stone) == 0)
                {
                    retVal.Add("1");
                    continue;
                }

                if (stone.Length % 2 == 0)
                {
                    var left = stone.Substring(0, stone.Length / 2);
                    var right = stone.Substring(stone.Length / 2);

                    retVal.Add(Double.Parse(left).ToString()); // Remove leading 0s
                    retVal.Add(Double.Parse(right).ToString());
                    continue;
                }

                retVal.Add((Double.Parse(stone) * 2024).ToString());
            }

            return retVal;
        }
